    public class SystemInfo
    {
        public const string PathMeta = "/template/meta";

        public static readonly string VirtualFolder;
        public static readonly string MedidaFileServer;
        public static readonly string DefaultConnectionDatabase;
        public static readonly string AppKey ;

        public const string FileManagerHost = "https://ofd.vn/";

        public const string PathFileManager = "/FileStorage/Storage";
        public const string ThumbsBasePathFileManager = "/FileStorage/thumbs";
        public const string PathRootFileManager = "//wwwroot/" + PathFileManager;
        public static string AbsolutePathFileManager = Directory.GetCurrentDirectory() + PathRootFileManager;

        public const string DefaultImage = PathFileManager + "/WebSetting/img/default.svg";
        public const string MetaFile = "/wwwroot/" + PathMeta + "/meta.html";


        // Static constructor
        static SystemInfo()
        {

          
            IConfiguration conf = (new ConfigurationBuilder()
                     .SetBasePath(Directory.GetCurrentDirectory())
                     .AddJsonFile($"appsettings.{Environment.GetEnvironmentVariable("ASPNETCORE_ENVIRONMENT")}.json", optional: true)  
                     .Build());
            VirtualFolder = InitializeValue(conf, "SystemConfig:VirtualFolder");
            MedidaFileServer = InitializeValue(conf, "SystemConfig:MedidaFileServer");
            DefaultConnectionDatabase = InitializeValue(conf, "SystemConfig:DefaultConnectionDatabase");
           AppKey = InitializeValue(conf, "Website:AppKey");
        }

        private static string InitializeValue(IConfiguration conf,string key)
        {
            try
            {
                string value = conf[key];

                return value;
            }
            catch (Exception)
            {

               return string.Empty;
            }
       
        }
    }
